// src/components/LandingPage.js
import React from 'react';
import { Link } from 'react-router-dom';

const LandingPage = () => {
    return (
        <div className="landing-page">
            {/* Navbar */}
            <header className="navbar">
                <h2 className="logo">CrickBidders</h2>
                <nav className="nav-links">
                    <Link to="/" className="nav-link">Home</Link>
                    <Link to="/signup" className="nav-link">Sign Up</Link>
                    <Link to="/login" className="nav-link">Log In</Link>
                    <Link to="/about" className="nav-link">About</Link>
                </nav>
            </header>

            {/* Main Content */}
            <main className="main-content">
                <h1>Welcome to CrickBidders</h1>
                <p>Your ultimate platform for cricket auctions!</p>
                <div className="button-container">
                    <Link to="/signup" className="button">Get Started</Link>
                    <Link to="/login" className="button">Log In</Link>
                </div>
            </main>

            {/* Footer */}
            <footer className="footer">
                <p>&copy; 2024 CrickBidders. All Rights Reserved.</p>
                <nav>
                    <Link to="/privacy" className="footer-link">Privacy Policy</Link> | 
                    <Link to="/terms" className="footer-link">Terms of Service</Link>
                </nav>
            </footer>
        </div>
    );
};

export default LandingPage;
